a:17:{s:4:"name";s:9:"Top Avana";s:11:"small_descr";s:301:"Top Avana is a drug which is used to treat male erectile dysfunction. It prolongs, and helps sustain the penile erection. Top Avana also helps treat premature ejaculation. It increases the sense of control, and sexual satisfaction in men. Top Avana tablet contains Avanafil 50 mg and Dapoxetine 30 mg.";s:14:"small_descr_de";s:361:"Top-Avana ist ein Medikament, das zur Behandlung der männlichen erektilen Dysfunktion eingesetzt wird.Es hilft dem Penis bei der Erektion und verlängert diese. Top-Avana hilft auch bei vorzeitigerEjakulation. Es erhöht das Gefühl der Kontrolle und der sexuellen Zufriedenheit bei Männern.Eine Top-Avana Tablette enthält 50 mg Avanafil und 30 mg Dapoxetin.";s:14:"small_descr_fr";s:374:"Top Avana est un médicament qui est utilisé pour traiter la dysfonction érectile masculine. Il prolonge et aide à maintenir l'érection du pénis. Top Avana aide également traiter l'éjaculation prématurée. Il augmente le sentiment de contrôle, et la satisfaction sexuelle chez les hommes. Un comprimé de Top Avana contient 50 mg de Avanafil et 30 mg de Dapoxetine.";s:14:"small_descr_es";s:341:"Top Avana es un medicamento que es utilizado para tratar la disfunción eréctil masculina. Ella prolonga, y ayuda a mantener la erección del pene. Top Avana ayuda también a tratar la eyaculación precoz. Aumenta la sensación de control, y la satisfacción sexual en los hombres. Top Avana contiene Avanafil (50 mg) y 30 mg de Dapoxetina.";s:14:"small_descr_it";s:0:"";s:10:"full_descr";s:4101:"<p><strong>INDICATIONS</strong><br /><br />Top Avana helps to achieve, sustain, and prolong penile erection. It significantly reduces premature ejaculations. It increases the sense of control, and sexual satisfaction in men. Super Avana has a quicker onset of action, and starts acting within 15 minutes of uptake.<br /><br />Avanafil acts by inhibiting a specific phosphodiester ase type 5 of an enzyme which is found in various body tissues, but mainly in the corpus cavernosum of penis. The enzymatic inhibition by Super Avana leads to prolonged and sustained penile erection.<br /><br />Dapoxetine acts by inhibiting the serotonin transporter, leading to increased serotonin's action at pre, and postsynaptic receptors. By regulating the central nervous system activity the sense of control increases, and premature ejaculations are significantly reduced.<br /><br /><strong>INSTRUCTIONS</strong><br /><br />Please consult a physician before taking the medication.<br /><br />Take one tablet of Top Avana about 30 minutes before sexual activity. Top Avana (Avanafil 50 mg plus Dapoxetine 30 mg) can be taken with or without food.<br /><br />The drug reaches at its peak activity in approximately 30 minutes. The results and performance of Top Avana varies from individual to individual.<br /><br />The maximum daily dose of Top Avana is Avanafil 50 mg plus Dapoxetine 30 mg.<br /><br /><strong>DOSAGE</strong> <br /><br />Take one tablet of Top Avana about 30 minutes before sexual activity. The maximum daily dose of Top Avana is (Avanafil 50 mg plus Dapoxetine 30 mg).<br /><br /><strong>STORAGE</strong> <br /><br />Store Top Avana tablets (A combination of Avanafil 50 mg plus Dapoxetine 30 mg) at 20&deg;C to 25&deg;C (68&deg;F to 77&deg;F). Protect from moisture and light.</p><p><strong>SAFETY INFORMATION</strong></p><p>Before using Top Avana tablets please inform your doctor about all the medicines that you take including no prescription medications, over the counter medicines and herbal remedies. The other warnings and precautions are:<br /><br />Top Avana is prescribed for adult males only (18 years and older).<br /><br />Before taking Top Avana get yourself checked for any kind of allergies to the drug.<br /><br />Avoid heavy alcohol consumption with the medication as it can lead to headache, dizziness, increased heart rate, and decrease in blood pressure in certain individuals.<br /><br />Grapefruit and grapefruit juice may interact with Top Avana and lead to potentially dangerous side effects.<br /><br />Avoid using other erectile dysfunction medicines when taking Top Avana.<br /><br />Patients with hepatic dysfunction should not take Top Avana.<br /><br />Top Avana cannot be used in patients with heart failure, permanent pacemaker, or other significant ischemic heart disease.<br /><br />Individuals taking SSRI medications for depression must consult a physician before they start taking Top Avana.<br /><br />Consult a physician immediately if you experience erections lasting longer than 4 hours, or painful erections. Prolonged erections can lead to permanent penile tissue damage<br /><br />Top Avana (A combination of Avanafil 50 mg plus Dapoxetine 30 mg) does not offer any additional protection from sexually transmitted diseases including AIDS (HIV). Using a condom is the only way to protect yourself from these diseases.</p><p><strong>SIDE EFFECTS</strong></p><p>The possible side effects of Top Avana are given below:<br /><br />Severe allergic reactions (rash, itching, difficulty breathing, tightness in the chest, swelling of the mouth, face, lips, or tongue). Consult a physician immediately if any of the mentioned signs appear after consuming Top Avana.<br /><br />Changes in vision, or sudden vision loss.<br /><br />Ringing sensation in ears, or sudden hearing loss.<br /><br />Chest pain, pounding heartbeats.<br /><br />Pain, swelling, warmth, or redness in the legs.<br /><br />Shortness of breath, swelling in your hands, or feet.<br /><br />Feeling of light-headedness.<br /><br />Painful Penis erection lasting for 4 hours, or longer.</p>";s:13:"full_descr_de";s:4675:"<p><strong>Indikationen</strong><br /><br />Top-Avana hilft die Erektion des Penis zu erreichen, zu erhalten, und zu verl&auml;ngern. Es reduziert die vorzeitige Ejakulation erheblich. Es erh&ouml;ht das Gef&uuml;hl der Kontrolle und der sexuellen Zufriedenheit bei M&auml;nnern. Die Wirkung tritt mit Top-Avana bereits innerhalb von 15 &nbsp;Minuten nach der Einnahme auf.<br />Avanafil wirkt durch Hemmung eines bestimmten Phosphodiesterase Typ 5, eines Enzyms, das in verschiedenen<br />K&ouml;rpergeweben zu finden ist, vor allem aber im Schwellk&ouml;rper des Penis. <br />Die enzymatische Hemmung von Top Avana f&uuml;hrt zu l&auml;nger anhaltenden Erektionen des Penis. Dapoxetin wirkt durch Hemmung der Serotonin-Transporter, was zu erh&ouml;htem Serotonin in den pre- und postsynaptischen Rezeptoren f&uuml;hrt. Durch die Regulierung der Aktivit&auml;t des zentralen Nervensystems wird das Gef&uuml;hl der Kontrolle erh&ouml;ht, und vorzeitige Ejakulationen werden deutlich reduziert.<br /><br /><strong>Anweisungen</strong><br /><br />Bitte konsultieren Sie einen Arzt vor der Einnahme des Medikamentes. Nehmen Sie eine Tablette von Top Avana etwa 30 Minuten vor der sexuellen Aktivit&auml;t. Super-Avana (Avanafil 50 mg plus Dapoxetine 30 mg) kann mit oder ohne Nahrung&nbsp;<br />eingenommen werden. Das Medikament erreicht seinen H&ouml;hepunkt nach ungef&auml;hr 30 Minuten.<br />Die maximale Tagesdosis von Top Avana ist Avanafil 50 mg plus Dapoxetine 30 mg.<br /><br /><strong>Dosierung</strong><br /><br />Nehmen Sie eine Tablette von Top Avana etwa 30 Minuten vor der sexuellen Aktivit&auml;t. Die maximale Tagesdosis von Top Avana ist Avanafil 50 mg plus Dapoxetine 30 mg.<br /><br /><strong>Aufbewahrung</strong><br /><br />Bewahren Sie Top-Avana Tabletten (Eine Kombination aus Avanafil 50 mg plus Dapoxetine 30 mg) bei 20 &deg; C bis 25 &deg; C (68 &deg; F bis 77 &deg; F) auf. Sch&uuml;tzen Sie Top-Avana vor Feuchtigkeit und Licht.</p><p><strong>SICHERHEITSHINWEISE</strong></p><p>Vor der Verwendung von Top Avana Tabletten informieren Sie bitte Ihren Arzt &uuml;ber alle Medikamente, die Sie einehmen, einschlie&szlig;lich nicht verschreibungspflichtiger Medikamente, over the counter Medikamente und pflanzliche Heilmittel. Die anderen Warnhinweise und Vorsichtsma&szlig;nahmen sind:<br />Top-Avana ist nur f&uuml;r erwachsene M&auml;nner (18 Jahre und &auml;lter)&nbsp;<br />vorgeschrieben.<br />Vor der Einnahme von Top-Avana, &uuml;berpr&uuml;fen Sie bitte, ob Sie auf irgendeinen Wirkstoff allergisch reagieren.<br />Vermeiden Sie schweren Alkoholkonsum mit dem Medikament, weil es zu Kopfschmerzen, Schwindel, erh&ouml;hter Herzfrequenz und Blutdruckabfall bei bestimmten Personen f&uuml;hren kann.<br />Grapefruit und Grapefruitsaft k&ouml;nnen mit Top-Avana interagieren und f&uuml;hren zu potentiell gef&auml;hrlichen Nebenwirkungen.<br />Vermeiden Sie die Verwendung anderer Medikamente gegen erektile Dysfunktion bei der Einnahme von Top-Avana.<br />Patienten mit Leberfunktionsst&ouml;rungen sollten nicht Top Avana nicht einnehmen.<br />Top-Avana kann nicht von Patienten mit Herzinsuffizienz, permanenten Herzschrittmachern oder anderen Herzkrankheiten eingesetzt werden.<br />Einzelpersonen, die SSRI Medikamente gegen Depressionen einnehmen, m&uuml;ssen einen Arzt konsultieren, bevor sie Top Avana einnehmen.<br />Konsultieren Sie sofort einen Arzt, wenn die Erektion l&auml;nger als 4 Stunden anh&auml;lt, oder die Erektion schmerzhaft ist. Anhaltende Erektionen k&ouml;nnen zu dauerhaften Gewebesch&auml;den f&uuml;hren.<br />Top-Avana (Kombination von Avanafil 50 mg plus 30 mg Dapoxetin) bietet keinen zus&auml;tzlichen Schutz vor sexuell &uuml;bertragbaren Krankheiten einschlie&szlig;lich AIDS (HIV). Die Verwendung eines Kondoms ist der einzige Weg, um sich vor diesen&nbsp;<br />Krankheiten zu sch&uuml;tzen.</p><p><strong>NEBENWIRKUNGEN</strong></p><p>Die m&ouml;glichen Nebenwirkungen von Top Avana sind:<br />Schwere allergische Reaktionen (Hautausschlag, Juckreiz, Atemnot, Engegef&uuml;hl in der Brust, Schwellungen im Mund,<br />Gesicht, Lippen oder Zunge). Konsultieren Sie sofort einen Arzt, wenn eines der genannten Symptome nach dem Konsum von Super Avana auftritt.<br />&Auml;nderungen in der Sicht, oder pl&ouml;tzlicher Verlust des Sehverm&ouml;gens.<br />Klingeln in den Ohren, oder pl&ouml;tzlicher H&ouml;rverlust.<br />Schmerzen in der Brust, pochender Herzschlag.<br />Schmerz, Schwellung, W&auml;rme, R&ouml;tung in den Beinen.<br />Atemnot, Schwellungen an Ihren H&auml;nden oder F&uuml;&szlig;en.<br />Gef&uuml;hl der Benommenheit.<br />Schmerzhafte Erektion, die 4 Stunden oder l&auml;nger andauert.</p>";s:13:"full_descr_fr";s:5610:"<p><strong>INDICATIONS</strong><br /><br />Top Avana aide &agrave; atteindre, maintenir et prolonger l'&eacute;rection du p&eacute;nis. Il r&eacute;duit consid&eacute;rablement &eacute;jaculations pr&eacute;matur&eacute;es. Il augmente le sentiment de contr&ocirc;le, et la satisfaction sexuelle chez les hommes. Top Avana a un d&eacute;but d'action plus rapide, et commence &agrave; agir &agrave; 15 minutes de l'absorption.<br /><br />Avanafil agit en inhibant une sp&eacute;cifique phosphodiester type ASE 5 d'une enzyme qui se trouve dans divers tissus du corps, mais principalement dans les corps caverneux du p&eacute;nis. L'inhibition enzymatique par Super Avana conduit &agrave; l'&eacute;rection du p&eacute;nis prolong&eacute;e et durable.<br /><br />Dapoxetine agit par inhibition du transporteur de la s&eacute;rotonine, ce qui conduit &agrave; l'action de la s&eacute;rotonine accrue au pr&eacute;, et r&eacute;cepteurs post-synaptiques. En r&eacute;gulant l'activit&eacute; du syst&egrave;me nerveux central le sens decontr&ocirc;le augmente, et des &eacute;jaculations pr&eacute;matur&eacute;es sont consid&eacute;rablement r&eacute;duits.</p><p><strong>INSTRUCTIONS</strong><br /><br />S'il vous pla&icirc;t consulter votre m&eacute;decin avant de prendre ce m&eacute;dicament.<br /><br />Prenez un comprim&eacute; de Top Avana environ 30 minutes avant l'activit&eacute; sexuelle. On peut prendre Top Avana (Avanafil 50 mg plus Dapoxetine 30 mg) avec ou sans nourriture.<br /><br />Le m&eacute;dicament arrive &agrave; son pic d'activit&eacute; en 30 minutes approximativement. Les r&eacute;sultats et les performances de Top Avana varient d'un individu &agrave; l'autre.<br /><br />La dose quotidienne maximale de Top Avana est (Avanafil 50 mg plus Dapoxetine 30 mg).</p><p><strong>DOSAGE</strong><br /><br />Prenez un comprim&eacute; de Top Avana environ 30 minutes avant l'activit&eacute; sexuelle. La dose quotidienne maximale de Top Avana est (Avanafil 50 mg plus Dapoxetine 30 mg).<br /><br /><strong>CONSERVATION</strong><br /><br />Conservez Top Avana (une combinaison de Avanafil 50 mg plus Dapoxetine 30 mg) &agrave; 20 &deg; C - 25 &deg; C (68 &deg; F &agrave; 77 &deg; F). Prot&eacute;gez de l'humidit&eacute; et de la lumi&egrave;re.</p><p><strong>RENSEIGNEMENTS DE S&Eacute;CURIT&Eacute;</strong></p><p>Avant de l'utilisation de&nbsp; Top Avana s'il vous pla&icirc;t informer votre m&eacute;decin de tous les m&eacute;dicaments que vous prenez, y compris les m&eacute;dicaments sur/sans ordonnance, m&eacute;dicaments en vente libre et de rem&egrave;des &agrave; base de plantes.&nbsp;<br /><br />Top Avana est prescrite pour les hommes adultes seulement (18 ans et plus).<br /><br />Avant de prendre Top Avana v&eacute;rifi&eacute;z si vous avez d'allergies &agrave; ce m&eacute;dicament.<br /><br />&Eacute;vitez la consommation excessive d'alcool avec les m&eacute;dicaments, car ce peut conduire &agrave; des maux de t&ecirc;te, des &eacute;tourdissements, augmentation du rythme cardiaque et une diminution de la pression art&eacute;rielle chez certaines personnes.<br /><br />Le pamplemousse et le jus de pamplemousse peuvent interagir avec Top Avana et conduire &agrave; des effets secondaires potentiellement dangereux.<br /><br />&Eacute;vitez d'utiliser les autres m&eacute;dicaments contre la dysfonction &eacute;rectile lors de la prise de Top Avana.<br /><br />Les patients avec le dysfonctionnement h&eacute;patique ne devrait pas prendre Top Avana.</p><p>Les patients qui ont l'insuffisance cardiaque, stimulateur cardiaque permanent, ou une autre maladie importante de cardiopathie isch&eacute;mique ne peuvent pas utiliser Top Avana.<br /><br />Les personnes qui prennent des m&eacute;dicaments ISRS pour la d&eacute;pression doivent consulter un m&eacute;decin avant de commencer &agrave; prendre Top Avana.<br /><br />Consulter un m&eacute;decin imm&eacute;diatement si vous ressentez une &eacute;rection qui dure plus de 4 heures ou &eacute;rections douloureuses. &Eacute;rections prolong&eacute;es peuvent conduire &agrave; des l&eacute;sions du tissu p&eacute;nien permanent<br /><br />Top Avana (Une combinaison de Avanafil (50 mg) et Dapoxetine (30 mg)) n'offre aucune protection suppl&eacute;mentaire contre les maladies sexuellement transmissibles y compris le SIDA (VIH). L'utilisation d'un pr&eacute;servatif est le seul moyen de se prot&eacute;ger contre ces maladies.</p><p><strong>LES EFFETS SECONDAIRES</strong></p><p>Les effets secondaires possibles de Top Avana sont donn&eacute;s ci-dessous:<br /><br />Les r&eacute;actions allergiques graves (&eacute;ruption cutan&eacute;e, d&eacute;mangeaisons, difficult&eacute; &agrave; respirer, sensation d'oppression dans la poitrine, enflure de la bouche, du visage, des l&egrave;vres ou de la langue). Consultez un m&eacute;decin imm&eacute;diatement si l'un des signes mentionn&eacute;s apparaissent apr&egrave;s la consommation de Super Avana.<br /><br />Changements dans la vision, ou une perte soudaine de vision.<br /><br />Tintement d'oreilles, ou une perte soudaine de l'audition.<br /><br />Douleur &agrave; la poitrine, battements de c&oelig;ur irr&eacute;guliers.<br /><br />Douleur, gonflement, chaleur, ou rougeur dans les jambes.<br /><br />Essoufflement, gonflement de vos mains ou des pieds.<br /><br />Sensation de t&ecirc;te l&eacute;g&egrave;re.<br /><br />&Eacute;rection douloureuse du p&eacute;nis qui dure pendant 4 heures, voire plus.guliers.<br /><br />Douleur, gonflement, chaleur, ou rougeur dans les jambes.<br /><br />Essoufflement, gonflement de vos mains ou des pieds.</p>";s:13:"full_descr_es";s:4950:"<p><strong>INDICACIONES</strong><br /><br />Top Avana ayuda a conseguir, mantener y prolongar la erecci&oacute;n del pene. Reduce significativamente la eyaculaci&oacute;n precoz. Aumenta la sensaci&oacute;n de control, y la satisfacci&oacute;n sexual en los hombres. Top Avana tiene un inicio de acci&oacute;n m&aacute;s r&aacute;pido y comienza a actuar dentro de los 15 minutos de la absorci&oacute;n.<br /><br />Avanafil act&uacute;a inhibiendo un tipo espec&iacute;fico de fosfodi&eacute;ster 5 ASE de una enzima que se encuentra en diversos tejidos del cuerpo, pero principalmente en el cuerpo cavernoso del pene. La inhibici&oacute;n enzim&aacute;tica de Top Avana conduce a la erecci&oacute;n del pene prolongada y sostenida.<br /><br />Dapoxetina inhibe el transportador de la serotonina, lo que lleva a la acci&oacute;n de la serotonina en el aumento de los receptores pre/postsin&aacute;pticos. A cause de la regulaci&oacute;n de la actividad del sistema nervioso central, el sentido de control aumenta, y eyaculaciones prematuras se reducen significativamente.</p><p><strong>INSTRUCCIONES</strong><br /><br />Por favor, consulte a un m&eacute;dico antes de tomar el medicamento.<br /><br />Tome una tableta de Top Avana a 30 minutos antes de la actividad sexual. Usted puede tomar Top Avana (Avanafil 50 mg + Dapoxetine 30 mg) con o sin alimentos.<br /><br />El f&aacute;rmaco alcanza en su actividad m&aacute;xima en aproximadamente 30 minutos. Los resultados y el rendimiento del Top Avana var&iacute;an de individuo a individuo.<br /><br />La dosis diaria m&aacute;xima de Top Avana es (Avanafil 50 mg m&aacute;s Dapoxetine 30 mg).</p><p><strong>DOSIS</strong><br /><br />Tome una tableta de Top Avana a 30 minutos antes de la actividad sexual. La dosis diaria m&aacute;xima de Top Avana es (Avanafil 50 mg + Dapoxetine 30 mg).<br /><br /><strong>ALMACENAMIENTO</strong><br /><br />Almac&eacute;n Top Avana (una combinaci&oacute;n de Avanafil 50 mg + 30 mg de dapoxetina) a 20 &deg; C - 25 &deg; C (68 &deg; F a 77 &deg; F). Proteja de la humedad y de la luz. F a 77</p><p><strong>INFORMACI&Oacute;N DE SEGURIDAD</strong></p><p>Antes de usar las tabletas de Top Avana consulte con su m&eacute;dico sobre todos los medicamentos que toma, incluyendo medicamentos sin receta, medicamentos de venta libre y remedios herbales.&nbsp;<br /><br />Top Avana es s&oacute;lo para los hombres adultos (18 a&ntilde;os y mayores).<br /><br />Antes de tomar Top Avana vaya a examinarse para cualquier tipo de alergia a la droga.<br /><br />Evitу el consumo excesivo de alcohol con el medicamento, porque eso puede causar dolor de cabeza, mareos, aumento del ritmo card&iacute;aco, y la disminuci&oacute;n de la presi&oacute;n sangu&iacute;nea en algunas personas.<br /><br />La toronja y el jugo de toronja pueden tener interacciones con Top Avana y pueden causar efectos secundarios potencialmente peligrosos.<br /><br />Evite el uso de otros medicamentos para la disfunci&oacute;n er&eacute;ctil cuando toma Top Avana.<br /><br />Los pacientes con disfunci&oacute;n hep&aacute;tica no deben tomar Top Avana.</p><p>Los pacientes con insuficiencia card&iacute;aca, marcapasos permanente, y otra enfermedad card&iacute;aca isqu&eacute;mica no pueden utilizar Top Avana.<br /><br />Las personas que toman medicamentos ISRS para la depresi&oacute;n deben consultar a un m&eacute;dico antes de comenzar a tomar &nbsp;Top Avana.<br /><br />Consulte a un m&eacute;dico inmediatamente si usted experimenta erecciones que duran m&aacute;s de 4 horas o erecciones dolorosas. Las erecciones prolongadas pueden llevar a un da&ntilde;o permanente del tejido del pene<br /><br />Top Avana (combinaci&oacute;n de Avanafil 50 mg + Dapoxetine 30 mg) no ofrece ninguna protecci&oacute;n adicional contra las enfermedades de transmisi&oacute;n sexual, incluido el SIDA (VIH). El uso del cond&oacute;n es la &uacute;nica manera de protecci&oacute;n contra estas enfermedades.o permanente del tejido del pene<br /><br />Top Avana (combinaci</p><p><strong>EFECTOS SECUNDARIOS</strong></p><p>Los posibles efectos secundarios de la Top Avana son:<br /><br />Reacciones al&eacute;rgicas graves (erupci&oacute;n cut&aacute;nea, picor, dificultad para respirar, opresi&oacute;n en el pecho, hinchaz&oacute;n de la boca, cara, labios, o lengua). Consulte a un m&eacute;dico inmediatamente si presenta alguno de los signos mencionados aparecen despu&eacute;s de consumo de S&uacute;per Avana.<br /><br />Cambios en la visi&oacute;n o p&eacute;rdida s&uacute;bita de la visi&oacute;n.<br /><br />Zumbido en los o&iacute;dos o p&eacute;rdida repentina de la audici&oacute;n.<br /><br />Dolor en el pecho, latidos del coraz&oacute;n.<br /><br />Dolor, hinchaz&oacute;n, calor o enrojecimiento en las piernas.<br /><br />Dificultad para respirar, hinchaz&oacute;n de las manos o pies.<br /><br />Mareo.<br /><br />Erecci&oacute;n del pene dolorosa que dura 4 horas o m&aacute;s.</p>";s:13:"full_descr_it";s:0:"";s:9:"min_price";s:8:"3.133746";s:9:"pack_name";s:5:"pills";s:4:"type";s:2:"mg";s:7:"analogs";a:2:{s:11:"Super Avana";s:20:"Erectile Dysfunction";s:17:"Extra Super Avana";s:20:"Erectile Dysfunction";}s:18:"active_ingredients";N;s:8:"packings";a:1:{i:80;a:6:{i:6197;a:5:{s:10:"id_packing";s:4:"6197";s:5:"count";s:2:"12";s:6:"dosage";d:80;s:14:"price_per_pill";s:6:"5.4978";s:4:"name";s:9:"Top Avana";}i:6198;a:5:{s:10:"id_packing";s:4:"6198";s:5:"count";s:2:"24";s:6:"dosage";d:80;s:14:"price_per_pill";s:7:"4.18444";s:4:"name";s:9:"Top Avana";}i:6199;a:5:{s:10:"id_packing";s:4:"6199";s:5:"count";s:2:"36";s:6:"dosage";d:80;s:14:"price_per_pill";s:7:"3.74665";s:4:"name";s:9:"Top Avana";}i:6200;a:5:{s:10:"id_packing";s:4:"6200";s:5:"count";s:2:"60";s:6:"dosage";d:80;s:14:"price_per_pill";s:7:"3.39642";s:4:"name";s:9:"Top Avana";}i:6201;a:5:{s:10:"id_packing";s:4:"6201";s:5:"count";s:2:"88";s:6:"dosage";d:80;s:14:"price_per_pill";s:7:"3.22926";s:4:"name";s:9:"Top Avana";}i:620